Konekti.plugin.html.getText( id ){
 fr = Konekti.util.vc(id)
 return fr.innerHTML
}

Konekti.plugin.html.setText( id, txt ){
 fr = Konekti.util.vc(id)
 fr.innerHTML = txt
}

Konekti.plugin.html = function( dictionary ){
 var id = dictionary.id
 if(dictionary.client!=null){
  var client = Konekti.server.client[dictionary.client]
  client.editor( id, function(){ return Konekti.plugin.html.getText(id) },	function(txt){ Konekti.plugin.html.setText(id, txt) })
	}
}
